script: |
  super -f text -I q9475.spq | sort > q9475.out

inputs:
  - name: q9475.spq
    data: |
      SELECT DISTINCT - - col2 FROM tab0 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN - + col1 AND col1 AND NOT col0 NOT IN ( + + col1, col1 * + 28 * - CAST ( NULL AS INTEGER ) );
  - name: tab0

outputs:
  - name: q9475.out
    data: |
